import React, { useState, useEffect } from "react";
import { Box, TextField, Button, Card, CardContent, Typography, InputAdornment } from "@mui/material";
import PersonIcon from "@mui/icons-material/Person";
import EmailIcon from "@mui/icons-material/Email";
import PhoneIcon from "@mui/icons-material/Phone";
import BusinessIcon from "@mui/icons-material/Business";
import WorkIcon from "@mui/icons-material/Work";

const ContactForm = ({ contact, onSave, onClose }) => {
    const [formData, setFormData] = useState({
        first_name: "",
        last_name: "",
        email: "",
        phone: "",
        company: "",
        job_title: "",
    });

    useEffect(() => {
        if (contact) {
            setFormData(contact);
        }
    }, [contact]);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log("Form data submitted:", formData); // Debugging log
        onSave(formData);
    };

    return (
        <Card
            sx={{
                maxWidth: 500,
                mx: "auto",
                mt: 4,
                boxShadow: 3,
                borderRadius: 2,
                backgroundColor: "#f7faff",
            }}
        >
            <CardContent>
                <Typography
                    variant="h4"
                    component="div"
                    gutterBottom
                    sx={{ textAlign: "center", mb: 4, fontWeight: "bold", color: "#333" }}
                >
                    Add Contact
                </Typography>
                <Box
                    component="form"
                    onSubmit={handleSubmit}
                    sx={{
                        "& .MuiTextField-root": { mb: 2 },
                        "& .MuiButton-root": { textTransform: "none" },
                    }}
                >
                    <TextField
                        label="First Name *"
                        name="first_name"
                        value={formData.first_name}
                        onChange={handleChange}
                        fullWidth
                        required
                        InputProps={{
                            startAdornment: (
                                <InputAdornment position="start">
                                    <PersonIcon color="primary" />
                                </InputAdornment>
                            ),
                        }}
                    />
                    <TextField
                        label="Last Name *"
                        name="last_name"
                        value={formData.last_name}
                        onChange={handleChange}
                        fullWidth
                        required
                        InputProps={{
                            startAdornment: (
                                <InputAdornment position="start">
                                    <PersonIcon color="primary" />
                                </InputAdornment>
                            ),
                        }}
                    />
                    <TextField
                        label="Phone Number *"
                        name="phone"
                        value={formData.phone}
                        onChange={handleChange}
                        fullWidth
                        required
                        InputProps={{
                            startAdornment: (
                                <InputAdornment position="start">
                                    <PhoneIcon color="primary" />
                                </InputAdornment>
                            ),
                        }}
                    />
                    <TextField
                        label="Email *"
                        name="email"
                        value={formData.email}
                        onChange={handleChange}
                        fullWidth
                        required
                        InputProps={{
                            startAdornment: (
                                <InputAdornment position="start">
                                    <EmailIcon color="primary" />
                                </InputAdornment>
                            ),
                        }}
                    />
                    <TextField
                        label="Company"
                        name="company"
                        value={formData.company}
                        onChange={handleChange}
                        fullWidth
                        InputProps={{
                            startAdornment: (
                                <InputAdornment position="start">
                                    <BusinessIcon color="primary" />
                                </InputAdornment>
                            ),
                        }}
                    />
                    <TextField
                        label="Job Title"
                        name="job_title"
                        value={formData.job_title}
                        onChange={handleChange}
                        fullWidth
                        InputProps={{
                            startAdornment: (
                                <InputAdornment position="start">
                                    <WorkIcon color="primary" />
                                </InputAdornment>
                            ),
                        }}
                    />
                    <Box mt={3} display="flex" justifyContent="space-between">
                        <Button
                            type="submit"
                            variant="contained"
                            sx={{
                                backgroundColor: "#28a745",
                                "&:hover": { backgroundColor: "#218838" },
                            }}
                        >
                            Submit
                        </Button>
                        <Button
                            variant="outlined"
                            onClick={onClose}
                            sx={{
                                borderColor: "#ffc107",
                                color: "#ffc107",
                                "&:hover": { backgroundColor: "#ffeeba" },
                            }}
                        >
                            Reset
                        </Button>
                    </Box>
                </Box>
            </CardContent>
        </Card>
    );
};

export default ContactForm;
